//rob-vl.synology.me:3404/d-solo/HknG8VyZz/drill-down?orgId=1&refresh=5s&theme=light&panelId=12&var-vat=',\n  \n  /**\n   * Grafana url for alcohol measurements\n   */\n  alcoholBaseUrl: 'https://rob-vl.synology.me:3404/d-solo/HknG8VyZz/drill-down?orgId=1&refresh=5s&theme=light&panelId=14&var-vat='\n}\n                        \n                    \n\n\n            \n        \n\n    src/environments/environment.ts\n    \n            \n            \n                \n                    \n                        \n                        \n                            \n                            environment\n                            \n                        \n                    \n                \n                    \n                        \n                            Type :         object\n\n                        \n                    \n                    \n                        \n                            Default value : {\n  /**\n   * app is not in production\n   */\n  production: false,\n\n  /**\n   * Base url to enable api calls (development stage)\n   */\n  baseUrl: 'https://localhost:5001/api/',\n  \n  /**\n   * Grafana url for pressure measurements\n   */\n  pressureBaseUrl: 'https://rob-vl.synology.me:3404/d-solo/HknG8VyZz/drill-down?orgId=1&refresh=5s&theme=light&panelId=2&var-vat=',\n  \n  /**\n   * Grafana url for temperature measurements\n   */\n  temperatureBaseUrl: 'https://rob-vl.synology.me:3404/d-solo/HknG8VyZz/drill-down?tab=visualization&orgId=1&refresh=5s&panelId=4&theme=light&var-vat=',\n  \n  /**\n   * Grafana url for acidity measurements\n   */\n  acidityBaseUrl: 'https://rob-vl.synology.me:3404/d-solo/HknG8VyZz/drill-down?orgId=1&refresh=5s&theme=light&panelId=10&var-vat=',\n  \n  /**\n   * Grafana url for turbidity measurements\n   */\n  turbidityBaseUrl: 'https://rob-vl.synology.me:3404/d-solo/HknG8VyZz/drill-down?orgId=1&refresh=5s&theme=light&panelId=8&var-vat=',\n  \n  /**\n   * Grafana url for carbon dioxide measurements\n   */\n  carbonDioxideBaseUrl: 'https://rob-vl.synology.me:3404/d-solo/HknG8VyZz/drill-down?orgId=1&refresh=5s&theme=light&panelId=12&var-vat=',\n  \n  /**\n   * Grafana url for alcohol measurements\n   */\n  alcoholBaseUrl: 'https://rob-vl.synology.me:3404/d-solo/HknG8VyZz/drill-down?orgId=1&refresh=5s&theme=light&panelId=14&var-vat='\n}\n                        \n                    \n\n\n            \n        \n\n    src/app/_animations/fade-in.animation.ts\n    \n            \n            \n                \n                    \n                        \n                        \n                            \n                            fadeInAnimation\n                            \n                        \n                    \n                \n                    \n                        \n                            Default value : trigger('fadeInAnimation', [\n\n        // route 'enter' transition\n        transition(':enter', [\n\n            // css styles at start of transition\n            style({ opacity: 0 }),\n\n            // animation and styles at end of transition\n            animate('.3s', style({ opacity: 1 }))\n        ]),\n    ])\n                        \n                    \n\n\n            \n        \n\n\n\n\n                   \n    \n         result-matching \"\"\n        \n    \n    \n        No results matching \"\"\n    \n\n"}}
